  render() {
    return (
      <React.Fragment>
        <h1>Hola desde Next</h1>
        <img src='/platzi-logo.png' />
        <p>Bienvenidos todos al curso de Next.js</p>
        <style jsx>
          {`
            h1 {
              color: red;
            }
            p {
              color: green;
            }
          `}
        </style>
        <style jsx global>
          {`
            body {
              background: yellow;
            }
          `}
        </style>
      </React.Fragment>
    );
  }
}
